import React from 'react';
import './Project.css';
import CardItem from './CardItem';

import libary from '../image/Camera Roll/lb.png';
import libary_q from '../image/Camera Roll/lb2.png';

import dum1 from '../image/Dum/1.png';
import dum2 from '../image/Dum/2.png';
import dum3 from '../image/Dum/3.png';
import dum4 from '../image/Dum/4.png';
import dum5 from '../image/Dum/5.png';
import dum6 from '../image/Dum/6.png';
import dum7 from '../image/Dum/7.png';





const Project = () => {
  return (
      <div className='cards'>
        <h1 style={{fontFamily:'monospace' ,color:'white'}}>PROJECT</h1>
        <div className='cards__container'>
          <div className='cards__wrapper'>
            <ul className='cards__items'>
              <CardItem
                src={dum4}
                text='Explore the hidden waterfall deep inside the Amazon Jungle'
              />
              <CardItem
                src={libary_q}
                text='Travel through the Islands of Bali in a Private Cruise'
              />
            </ul>
            <ul className='cards__items'>
              <CardItem
                src='images/img-3.jpg'
                text='Set Sail in the Atlantic Ocean visiting Uncharted Waters'
              />
              <CardItem
                src='images/img-4.jpg'
                text='Experience Football on Top of the Himilayan Mountains'
                label='Adventure'
                path='/products'
              />
              <CardItem
                src='images/img-8.jpg'
                text='Ride through the Sahara Desert on a guided camel tour'
              />
            </ul>
          </div>
        </div>
    </div>
  )
}

export default Project;
